const ext_id = "Emojis";
const ext_cover =
  "data:image/png;base64,";
const ext_icon = "data:image/png;base64,"

// Need to fetch in load
var emoji = [];
var flag = false;

class EasyEmojis {
  _formatMessage;
  runtime;
  constructor(runtime) {
    this.runtime = runtime;
    this._formatMessage = runtime.getFormatMessage({
      "zh-cn": {
        "ee.extensionName": "表情符号",

        "ee.button.help": "速查表",
        "ee.button.help.url": "https://dilemmagx.github.io/extension-docs/lib/emojis/support-cn.html",

        "ee.block.load":"加载数据并等待",
        "ee.block.loaded":"已加载",

        "ee.block.getAll": "获取全部数据",
        "ee.block.getEmoji": "尝试根据[b]获取[name]的表情的[t]",
        "ee.block.parseEmoji": "尝试解析[text]",

        "ee.menu.b.char": "表情符号",
        "ee.menu.b.name": "表情名称",
        "ee.menu.b.id": "表情id",
        "ee.menu.b.codes": "Unicode",

        "ee.menu.t.char": "表情符号",
        "ee.menu.t.name": "表情名称",
        "ee.menu.t.id": "表情id",
        "ee.menu.t.group": "组别",
        "ee.menu.t.subgroup": "附属组别",
        "ee.menu.t.codes": "Unicode",
        "ee.menu.t.JSON": "JSON",
      },
      en: {
        "ee.extensionName": "Emojis",

        "ee.button.help": "Cheat sheet",
        "ee.button.help.url": "https://dilemmagx.github.io/extension-docs/lib/emojis/support-en.html",

        "ee.block.load":"Load data and wait",
        "ee.block.loaded":"Loaded",

        "ee.block.getAll": "get all data",
        "ee.block.getEmoji": "try to get the[t]of[b][name]",
        "ee.block.parseEmoji": "try to parse[text]",

        "ee.menu.b.char": "emoji symbol",
        "ee.menu.b.name": "emoji name",
        "ee.menu.b.id": "emoji id",
        "ee.menu.b.codes": "Unicode",

        "ee.menu.t.char": "emoji symbol",
        "ee.menu.t.name": "emoji name",
        "ee.menu.t.id": "emoji id",
        "ee.menu.t.group": "group",
        "ee.menu.t.subgroup": "subgroup",
        "ee.menu.t.codes": "Unicode",
        "ee.menu.t.JSON": "JSON",
      },
    });
  }
  formatMessage(id) {
    return this._formatMessage({
      id,
      default: id,
      description: id,
    });
  }
  getInfo() {
    return {
      id: ext_id, // ext id
      name: this.formatMessage("ee.extensionName"), // ext name
      color1: "#3371fc",
      menuIconURI: ext_icon,
      blockIconURI: ext_icon,
      blocks: [
        {
          blockType: Scratch.BlockType.BUTTON,
          text: this.formatMessage("ee.button.help"),
          onClick: () => {
            window.open(this.formatMessage("ee.button.help.url"))
          },
        },
        {
          opcode: "load",
          blockType: "command",
          text: this.formatMessage("ee.block.load"),
          arguments: {},
          disableMonitor: true,
        },
        {
          opcode: "loaded",
          blockType: "Boolean",
          text: this.formatMessage("ee.block.loaded"),
          arguments: {},
          disableMonitor: false,
        },
        {
          opcode: "getAll",
          blockType: "reporter",
          text: this.formatMessage("ee.block.getAll"),
          arguments: {},
          disableMonitor: true,
        },
        {
          opcode: "getEmoji",
          blockType: "reporter",
          text: this.formatMessage("ee.block.getEmoji"),
          arguments: {
            name: {
              type: "string",
            },
            t: {
              type: "string",
              menu: "t",
              defaultValue: "char",
            },
            b: {
              type: "string",
              menu: "b",
              defaultValue: "name",
            },
          },
          disableMonitor: true,
        },
        {
          opcode: "parseEmoji",
          blockType: "reporter",
          text: this.formatMessage("ee.block.parseEmoji"),
          arguments: {
            text: {
              type: "string",
            }
          },
          disableMonitor: true,
        },
      ],
      menus: {
        b: [
          {
            text: this.formatMessage("ee.menu.b.char"),
            value: "char",
          },
          {
            text: this.formatMessage("ee.menu.b.name"),
            value: "name",
          },
          {
            text: this.formatMessage("ee.menu.b.id"),
            value: "id",
          },
          {
            text: this.formatMessage("ee.menu.b.codes"),
            value: "codes",
          },
        ],
        t: [
          {
            text: this.formatMessage("ee.menu.t.JSON"),
            value: "json",
          },
          {
            text: this.formatMessage("ee.menu.t.char"),
            value: "char",
          },
          {
            text: this.formatMessage("ee.menu.t.name"),
            value: "name",
          },
          {
            text: this.formatMessage("ee.menu.t.id"),
            value: "id",
          },
          {
            text: this.formatMessage("ee.menu.t.group"),
            value: "group",
          },
          {
            text: this.formatMessage("ee.menu.t.subgroup"),
            value: "subgroup",
          },
          {
            text: this.formatMessage("ee.menu.t.codes"),
            value: "codes",
          },
        ],
      },
    };
  }
  async load() {
    try {
      const response = await fetch('https://unpkg.com/@angelofana/emoji-json@15.1.1/emoji-array.json');
      console.log('response: ', response);
      const data = await response.json();
      emoji = data;
      flag = true;
      console.log('✅Emojis loaded!');
    } catch (error) {
      console.error('🚨Error loading emojis:', error);
    }
  }

  loaded(){
    return flag;
  }

  getAll() {
    return JSON.stringify(emoji);
  }
  getEmoji(args) {
    for (var i = 0; i < emoji.length; i++) {
      if (args.b == "id") {
        args.name = args.name.replace(/:([^:]+):/g, (match, p1) =>
          p1.replace(/-/g, " ")
        );
        args.b = "name";
      }
      if (
        emoji[i][args.b].localeCompare(args.name, "en", {
          sensitivity: "base",
        }) == 0
      ) {
        if (args.t == "json") {
          return JSON.stringify(emoji[i]);
        } else if (args.t != "id") {
          return emoji[i][args.t];
        } else return ":" + emoji[i].name.replace(/ /g, "-") + ":";
      }
    }
    return "undefined";
  }
  parseEmoji(args) {
    var r_text = args.text;
    for (let i = 0; i < emoji.length; i++) {
      const regex = new RegExp(
        ":" + emoji[i].name.replace(/ /g, "-") + ":",
        "gi"
      );
      r_text = r_text.replace(regex, emoji[i].char);
    }
    return r_text;
  }
}

window.tempExt = {
  Extension: EasyEmojis,
  info: {
    name: "ee.extensionName",
    description: "ee.description",
    extensionId: ext_id,
    iconURL: ext_cover,
    insetIconURL: ext_icon,
    featured: true,
    disabled: false,
    collaborator: "官方小傲娇 @ CCW",
    collaboratorURL: "https://www.ccw.site/student/62f76ddb49c5dc44ac0c03c0",
    collaboratorList: [
      {
        collaborator: "官方小傲娇 @ CCW",
        collaboratorURL:
          "https://www.ccw.site/student/62f76ddb49c5dc44ac0c03c0",
      },
    ],
  },
  l10n: {
    "zh-cn": {
      "ee.extensionName": "表情符号",
      "ee.description": "🤡👈🤣",
    },
    en: {
      "ee.extensionName": "Emojis",
      "ee.description": "🤡👈🤣",
    },
  },
};
